<?php
include 'utils/apiConstants.php';

function getUserDetails($userId){
	
	$query = "Select * from ".USER_TABLE."
			  WHERE ".ID." = '$userId'";

	$userQueryResult = mysql_query($query);
	$userQueryRow = mysql_fetch_array ( $userQueryResult );
	
	$userModel = new UserModel();
	
	$userModel->setDriverId($userQueryRow[USER_ID]);
	$userModel->setDrivername($userQueryRow[USER_NAME]);
	$userModel->setDriverPhoneNumber($userQueryRow[USER_PHONE_NUMBER]);
	$userModel->setIsVerfied($userQueryRow[IS_USER_VERIFIED]);
	$userModel->setDriverEmail($userQueryRow[USER_EMAIL]);
	$userModel->setDriverImageUrl($userQueryRow[USER_IMAGE]);
	$userModel->setGender($userQueryRow[USER_GENDER]);
	$userModel->setDriverAge($userQueryRow[USER_AGE]);
	$userModel->setDriverRating($userQueryRow[USER_RATING]);
	
	return $userModel;
}

function getCarDetails($carId){

	$query = "Select * from ".CAR_TABLE."
			  WHERE ".ID." = '$carId'";
	
	$carQueryResult = mysql_query($query);
	$carQueryRow = mysql_fetch_array ( $carQueryResult );
	$carModel = new CarModel();
		
	$carModel->setCarId($carQueryRow[ID]);
	$carModel->setCompany($carQueryRow[CAR_COMPANY]);
	$carModel->setCarModel($carQueryRow[CAR_MODEL]);
	$carModel->setCarColor($carQueryRow[CAR_COLOR]);
	$carModel->setLicensePlateNumber($carQueryRow[CAR_PLATE_NUMBER]);
	
	return $carModel;
}

function getRoutesDetails($routeId){

	$query = "Select * from ".ROUTE_TABLE."
			  WHERE ".ROUTE_ID." = '$routeId'";

	$routeQueryResult = mysql_query($query);
	$routeArray = array();
	if(mysql_num_rows($routeQueryResult) > 0)
	{
		while($row = mysql_fetch_array($routeQueryResult))
		{
			$routeArray [] =$row[ROUTE_POINT];
		}
	}
	return $routeArray;
}

